import React from "react";

const Projects = () => {

  return (
    <section className="projects-section">
      <div>
        <h1>React Apps</h1>
        <h1>These are a few of my React apps that I have developed when I first started. Originally, I built 
        these using traditional React components on Codepen. I revamped the frontend with a different design
        and I rewrote the code using hooks and ES6.</h1>


      </div>
    </section>
  );
}

export default Projects;
